100s with no straps after a little upper body hiatus. I took 2023 to add some size to my lower body while actively trying to downsize my upper to make myself feel a little more balanced. I accomplished just that, so now it’s time for something else. Here’s 3 things I learned after my experiment: 

1. muscle and strength doesn’t just go away, you feel flat and get in your head about it, but if you’re still active you don’t just turn into a blob (lol). Strength comes back in a few weeks if you have a strong baseline.

2. Less is more. THIS. I’ve always been a work horse when it comes to checking my fitness boxes and trying to do it all. This past year I swapped my usual cardio for just walking/rucking and lifting 4x per week instead of 5. All that happened was my blood work improved, I was less anxious, could sleep better, looked fuller and my legs and glutes finally did grow. Big thanks to @luke_the_hulk for teaching me this concept with his program from @granitesupplements 

3. I spent years trying to BUILD my body and turns out I still love taking up space and am no longer embarrassed about being a “big arm/back girl”😉

Something to keep in mind as you think about your 2024 goals: 👉Strength is a personal measurement for a truly unique, subjective experience. It’s entirely up to you to decide what strong means for YOU. 👈

More training videos coming as I fall in love with strength training (my entire body) again. 😀❤️

